import React, { Component } from 'react'
import { Form, Formik, Field, ErrorMessage } from 'formik'
import TodoDataService from '../../api/todo/TodoDataService.js'
import AuthenticationService from '../../api/todo/AuthenticationService.js';
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

// Page to update or add a specific todo
class TodoComponent extends Component {



    constructor(props) {
        super(props)

        // State of the page - contains id, desc, and date for a specific todo.
        this.state = {
            name: '',
            email: '',
            password: '',
            businessNam: '',

        }

        this.onSubmit = this.onSubmit.bind(this)
        this.validate = this.validate.bind(this);

    }


    // on Formik Submit, add user
    onSubmit(values) {

        // retrieve business object

        let username = AuthenticationService.getLoggedInEmail();
        let todo = {
            id: this.state.id,
            description: values.description,
            targetDate: values.targetDate
        }

        console.log(this.state.id)

        // if state (todo id) is -1, means todo does not exist yet, means create todo
        if (this.state.id == -1) {
            console.log("id=1")
            TodoDataService.createTodo(username, todo)
                .then(() => this.props.history.push("/todos"))
            // else state (todo id) is not -1, means todo exists, means update todo
        } else {
            TodoDataService.updateTodo(username, this.state.id, todo)
                .then(() => this.props.history.push("/todos"))
        }
    }

    // on Formik Validate call
    // if errors populated, will not call onSubmit above
    validate(values) {
        let errors = {}

        if (!values.name) {
            errors.description = "Enter your name"
        } 

        if (!values.email) {
            errors.description = "Enter your email"
        } 

        if (!values.password) {
            errors.description = "Enter a password"
        } else if (values.password.length < 5) {
            errors.description = "Enter at least 5 characters for password"
        }

        if (!values.businessNam) {
            errors.description = "Enter your business name"
        } 

        return errors
    }

    render() {

        let { name, email, password, businessNam } = this.state

        return (
            <div>
                <Container>
                    <Row>
                        <Col></Col>
                        <Col>
                <h1 className="text-white">Todo</h1>
                <div className="container text-white">
                    <Formik
                        initialValues={{ name, email, password, businessNam }}
                        onSubmit={this.onSubmit}
                        validateOnChange={false}
                        validateOnBlur={false}
                        validate={this.validate}
                        enableReinitialize={true}
                    >
                        {
                            (props) => (
                                <Form>
                                    <ErrorMessage name="name" component="div" className="alert alert-warning "></ErrorMessage>
                                    <ErrorMessage name="email" component="div" className="alert alert-warning"></ErrorMessage>
                                    <ErrorMessage name="password" component="div" className="alert alert-warning "></ErrorMessage>
                                    <ErrorMessage name="businessNam" component="div" className="alert alert-warning"></ErrorMessage>
                                    <fieldset className="form-group">
                                        <label>Name</label>
                                        <Field className="form-control" type="text" placeholder="Enter name" name="name"></Field>
                                    </fieldset>
                                    <fieldset className="form-group">
                                        <label>Email Address</label>
                                        <Field className="form-control" type="email" placeholder="Enter email" name="email"></Field>
                                    </fieldset>
                                    <fieldset className="form-group">
                                        <label>Password</label>
                                        <Field className="form-control" type="password" placeholder="Enter password" name="password"></Field>
                                    </fieldset>
                                    <fieldset className="form-group">
                                        <label>Your Business Name</label>
                                        <Field className="form-control" type="text" placeholder="Enter Business Name" name="businessNam"></Field>
                                    </fieldset>
                                    <button className="btn btn-success" type="submit" >Sign Up</button>
                                </Form>
                            )
                        }
                    </Formik>
                </div>
                </Col>
                <Col></Col>
                </Row>
                </Container>
            </div>
        )
    }
}

export default TodoComponent;
